import React, { Component } from 'react'
import { Person,MenuBook,Room,
    Cake,Favorite,People,Email } from '@material-ui/icons';
import './style.css'
export class index extends Component {
    constructor(props){
		super(props);
		this.reftextarea = React.createRef();
    };
    componentDidMount(){
        if (this.reftextarea){
            this.reftextarea.style.height = this.reftextarea.scrollHeight + "px";
        }

    };
  render() {
    return (
      <div className='perso-container'>
          <div className='perso-header'>
            <div className='header-top'>
                <img src='https://cdn.pixabay.com/photo/2022/03/30/15/52/gerbera-7101430_960_720.jpg' alt='mur'/>
                <img src='https://cdn.pixabay.com/photo/2022/04/06/11/30/girl-7115394_960_720.jpg' alt='avatar'/>
            </div>

            <div className='menu'>
                <ul>
					<li>Image</li>
					<li>Videos</li>
					<li>Pages</li>
                    <li>Groups</li>
					<div className="animation start"></div>
				</ul>
            </div> 
          </div>
          <div className='perso-footer'>
            <div className='footer-left'>
                <div className='top'>
                    <span>Personal infos</span>
                </div>
                <span>About</span>
                <div className='input-data'>
                    <textarea ref={this.reftextarea} className='area'/>
                    <span>Ok</span>
                </div>
            </div>
            <div className='footer-right'>

            </div>
          </div>
      </div>
    )
  }
}

export default index
